import React from 'react';

const TrackList = ({ tracks, onPlay }) => {
    return (
        <div>
            {tracks.map(track => (
                <div key={track.trackId} onClick={() => onPlay(track.previewUrl)}>
                    {track.trackName} by {track.artistName}
                </div>
            ))}
        </div>
    );
};

export default TrackList;
